function getPage(e,a,t,s){$.post("/getNewsPag",{created:e,categories:a,pageNumber:t,pageSize:s},function(e){1==e.status&&($("#sameType").empty(),$.each(e.news,function(e,a){var t=new Date(a.created),s='<div class="regular-news"><i class="fa fa-caret-right"></i><a class="title" href="/tintuc/'+t.getTime()+'">'+a.title.tonal+'<span class="createdDate"> ('+t.getDate()+"/"+(t.getMonth()+1)+"/"+t.getFullYear()+")</span></a></div>";$("#sameType").append(s)}))})}$(document).ready(function(){});